
function toggleQRMenu() {
    var shopping = `data:image/png;base64,`;
    var close = `data:image/png;base64,`;
    var frame = document.getElementById("QRMenuFrame");
    var image = document.getElementById("QRMenuBtnImage");
    if(frame){
        image.src = frame.style.display === 'none' ?  close : shopping;
        frame.style.display = frame.style.display === 'none' ?  'block' : 'none';

    }
}


function getTemplate(url) {

    return `<a id="QRMenuMainButton" href="javascript:toggleQRMenu()">
        <img style="width: 50px; height: 50px; position: absolute; right: 30px; bottom: 80px; z-index: 99999" id="QRMenuBtnImage" alt="">
    </a>
    <div id="QRMenuFrame" style="position: absolute;right: 100px; top: calc((100vh - 560px)/2);z-index: 99; display: none">
    <iframe id="inlineFrameExample" style="border: 2px solid black;"
            title="QR MENU"
            width="280"
            height="560"
            src="${url}">
    </iframe>
    </div>`;
}

onload = function(){
    document.getElementsByTagName("body")[0].innerHTML+=getTemplate("https://devapp.qrmenu.cl/parque-arauco");
    toggleQRMenu()
};


